// src/components/Dashboard.js
import React from 'react';
import { Container, Card, Typography } from '@mui/material';

const Dashboard = () => {
    return (
        <Container maxWidth="lg" className="mt-10 flex flex-col items-center">
            <Card className="shadow-lg rounded-lg w-full h-[75vh] flex items-center justify-center">
                <Typography variant="h4" className="text-center font-bold text-white text-5xl">
                    <Typical
                        steps={['Welcome to Study Buddy', 1000, 'We help you find study buddies!', 1000]}
                        loop={Infinity}
                        wrapper="span"
                    />
                </Typography>
            </Card>
            <div className="mt-8 flex flex-col items-center">
                <Card className="m-2 p-4 w-full max-w-xs bg-blue-500 rounded-lg shadow-lg text-white">
                    <Typography variant="h5">Math 135</Typography>
                </Card>
                <Card className="m-2 p-4 w-full max-w-xs bg-blue-500 rounded-lg shadow-lg text-white">
                    <Typography variant="h5">CS 135</Typography>
                </Card>
            </div>
        </Container>
    );
};

export default Dashboard;
